$(document).ready(function() {

  var $body = $('body');

  console.log('Start application');

  $.ajax({
    type: "GET",
    url: "combos.json" 
  }).done(function( data ) {
    console.log(data);
    console.log('Ready Combos JSON');
    var _combos = data.combos;

    for (var i = 0; i < _combos.length; i++) {
      var _combo = _combos[i];
      console.log('COMBO ' + _combo.showName);

      var comboElem = $('<li>').attr('id', _combo.name).data('config', _combo.parts);
      var comboName = $('<div>').html('<p>' + _combo.showName + '</p>');

      for (var j = 0; j < _combo.parts.length; j++) {
        var colorComboElem;
        if (_combo.parts[j].color == "chrome") {
          colorComboElem = $('<span class="chrome-config-combo">');
        } else if (_combo.parts[j].color == "bw") {
          colorComboElem = $('<span class="bw-config-combo">');
        } else {
          colorComboElem = $('<span style="background-color: #' + _combo.parts[j].color + '">');
        }

        colorComboElem.appendTo(comboElem);
      };
      comboName.prependTo(comboElem);
      console.log(comboElem);
      comboElem.appendTo('#combo-selector');
    }
  });

  $.ajax({
    type: "GET",
    url: "color.json" 
  }).done(function( data ) {
    console.log('Ready Color JSON');
    bikeColorsObj = data.parts;
    var dataLength = data.parts.length;
    for (var i = 0; i < dataLength; i++) {
      var $tag = $('<span>'),
          $palletColor = $('<div>'),
          part = data.parts[i];
      
      $tag.addClass('toggle-options-call tag ' + 'tag-' + part.name).data({
        'part' : part.name,
        'colors' : part.colors
      }).attr('id', 'tag-' + part.name);

      $palletColor.addClass('pallet pallet-' + part.colors.length).attr('id', 'pallet-' + part.name);
      for (var j = 0; j < part.colors.length; j++) {
        var $color = $('<span></span>');
        $color.addClass('pallet-color pallet-color' + j).data({
          'index' : i,
          'color' : part.colors[j].color,
          'part' : part.name,
          'showName' : part.showName,
          'colorName' : part.colors[j].showName
        });

        if (dataLength !== 2 || dataLength !== 4 || dataLength !== 8) {
          $palletColor.addClass('pallet-' + dataLength + 'options');
        };


        if (part.colors[j].color == "chrome") {
          $color.css('background-image', 'url(configurador/bg_cromado.png)');
        } else if (part.colors[j].color == "bw") {
          $color.css('background', 'url(configurador/pb.png) center center');
        } else {
          $color.css('background-color', '#' + part.colors[j].color);
        }

        $palletColor.append($color);

      }
      var $partSelector = $('<li>'),
          $spanColor = $('<span>');
      $partSelector.addClass('partSelector').attr('id', 'partSelector-' + part.name).text(part.showName).data('part', part.name);
      
      if (part.colors[0].color == "chrome") {
        $spanColor.css('background', 'url(configurador/bg_cromado.png)');
      } else if (part.colors[0].color == "bw") {
        $spanColor.css('background', 'url(configurador/pb.png) center center');
      } else {
        $spanColor.css('background-color', '#' + part.colors[0].color)
      }

      
      $partSelector.prepend($spanColor);
      $('#parts-selector').append($partSelector);
      
      $tag.append($palletColor);
      $('#areabike').append($tag);

      configPart(i, part.name, part.showName, part.colors[0].color, part.colors[0].showName);

    }
    $('#visualizador').animate({
      'opacity' : 1
    }, 1000);
  });

  $('.change-configurator a').on('click', function(e) {
    console.log($(this).attr('id'));
    $('.change-configurator a').removeClass('selected');
    $(this).addClass('selected');

    if ($(this).attr('id') == 'change-color') {
      $('#combo-selector').fadeOut(500, function(){
        console.log('Fechando combos de cor');
        $('#parts-selector').fadeIn(500);
      });
    } else {
      $('#parts-selector').fadeOut(500, function(){
        console.log('Fechando palheta de cores');
        $('#combo-selector').fadeIn(500);
      });
    };
    e.preventDefault();
  });

  $body.on('click', '#combo-selector li', function(e) {
    
    var _config = $(this).data('config');
    console.log('Click Combo Selector');
    console.log(_config);

    for (var i = 0; i < _config.length; i++) {
      simpleConfigPart(_config[i].partName, _config[i].color);
      // configPart(i, _config[i].part, _config[i].partName, data.color, data.colorName);
    }
  });

  $('.botoes_float').on('click', function(e) {
    e.stopPropagation();
  });

  $body.on('click', function(e) {
    $('.pallet').hide();
  });

  $body.on('click', '.partSelector', function(e) {
    $('.tag').fadeIn(200);
    showPallete($(this).data('part'));
    e.stopPropagation();
  });

  $body.on('click', '.toggle-options-call', function (e) {
  	$('.tag').removeClass('tag-active');
  	$(this).addClass('tag-active');
    showPallete($(this).data('part'));
    e.stopPropagation();
  });

  $body.on('click', '.pallet-color', function(e) {
    var data = $(this).data();
    configPart(data.index, data.part, data.showName, data.color, data.colorName);
    
    e.stopPropagation();
  });

  $body.on('click', '#visualizador-conf', function(e) {
    if ($(this).text() == "Ocultar") {
      $(this).text("Mostrar");
    } else {
      $(this).text("Ocultar");
    }
    $('.tag').fadeToggle(200);
    e.stopPropagation();
  });

  $body.on('click', '#buy-btn', function(e) {
    for (var k = 0; k < configBike.length; k++) {
      var $tr = $('#base-tr').clone();
      console.log(configBike[k]);
      $tr.find('.part-table').text(configBike[k].name);
      $tr.find('.name-color-table').text(configBike[k].colorName);
      if (configBike[k].color == "chrome") {
        $tr.find('.color-config').css('background', 'url(configurador/bg_cromado.png)');
      } else if (configBike[k].color == "bw") {
        $tr.find('.color-config').css('background', 'url(configurador/pb.png) center center');
      } else {
        $tr.find('.color-config').css('background-color', '#' + configBike[k].color)
      }
      $tr.addClass('dinamicTr').show();
      $('#config-bike-table').append($tr);
    }
    $('.height-bike-table').text($('.height-config:checked').val());
    $('.overlay-modal').fadeIn(200, function(){
      $('#checkout-bike').animate({
        'top' : 50
      }, 800);
      
    });
    e.stopPropagation();
  });

  $body.on('click', '.btn-close-modal', function(e) {
    $('#checkout-bike').animate({
      'top' : -800
    }, 800, function() {
      $('.overlay-modal').fadeOut(100);      
      $('.dinamicTr').remove();
    });
    e.stopPropagation();
  });

  $body.on('click', '#logo-color-bikes-app', function() {
    window.location.reload();
  });
  
});

var configBike = [];
var bikeColorsObj = [];

var simpleConfigPart = function(_part, _color) {
  console.log('Part: ' + _part + ' and color: ' + _color);
  for (var i = 0; i < bikeColorsObj.length; i++) {
    if (_part == bikeColorsObj[i].name) {
      console.log('IGUAL');
      for (var j = 0; j < bikeColorsObj[i].colors.length; j++) {
        if (_color == bikeColorsObj[i].colors[j].color) {
          console.log('COR IGUAL: ' + _color);
          configPart(i, _part, bikeColorsObj[i].showName, _color, bikeColorsObj[i].colors[j].showName);
          break;
        }
      };
      break;
    }
  }
};

var configPart = function(index, _part, _name, _color, _colorName) {

  configBike[index] = {
    'part' : _part,
    'name' : _name,
    'color' : _color,
    'colorName' : _colorName
  };

  if (_part == 'coroa') {
      $(".bg_coroa").css("background-image","url('configurador/bg_pedivela.png')");
      $('#coroa_co').attr('fill', "#" + _color);
      $('#coroa_pv').attr('fill', "#" + _color);
    }

    if (_part == "arod") {
      $('.bg_aro_dianteiro').css('opacity', 0.2);
    }

    if (_part == "arot") {
      $('.bg_aro_traseiro').css('opacity', 0.2);
    }

    if (_part == "arcanoteot") {
      $('.bg_canote').css('opacity', 0.2);
    }
    if (_part == "canote") {
      if (_color !== "chrome") {
        $('#canote-fix-svg').css('opacity', 1);
      } else {
        $('#canote-fix-svg').css('opacity', 0);
      }
    }

    if (_color == "chrome" || _color == "bw") {
      if (_part == "coroa") {
        if (_color == "chrome") {
          $(".bg_coroa").css("background-image","url('configurador/coroa.png')");
        } else if (_color == "bw") {
          $('#coroa_co').attr('fill', "#000000");
          $('#coroa_pv').attr('fill', "#e9e9e9"); 
        }
      } else if (_part == "arod" || _part == "arot") {
        $('.' + _part + '-svg').attr('fill', "#eeeeee");
        if (_part == "arod") {
          $('.bg_aro_dianteiro').css('opacity', 0.8);
        } else if (_part == "arot") {
          $('.bg_aro_traseiro').css('opacity', 0.8);
        }
      } else if (_part == "canote") {
        $('.' + _part + '-svg').attr('fill', "#eeeeee");
        $('.bg_canote').css('opacity', 0.8);
      }

      if (_color == "chrome") {
        $('#partSelector-' + _part + ' span').css('background', 'url(configurador/bg_cromado.png)');
      } else if (_color == "bw") {
        $('#partSelector-' + _part + ' span').css('background', 'url(configurador/pb.png) center center');
      }
    } else {
      $('.' + _part + '-svg').attr('fill', "#" + _color);
      $('#partSelector-' + _part + ' span').css('background', '#' + _color);
    }

    $('.pallet').hide();
};

var showPallete = function(part) {
  $('.pallet').hide().css('opacity', 0);
  $('#pallet-' + part).show().animate({
    'opacity' : 1
  }, 500);
};